import React, { Component } from 'react';
import axios from 'axios';
import "bootstrap/dist/css/bootstrap.min.css";

export default class Login extends Component {


    login() {
	let obj = {};
	obj.username = this.props.username;
	obj.password = this.props.password;


	axios({
	    method: 'post',
	    url: 'http://localhost:4000/consortium/login',
	    data: obj,
	    config: { headers: {'Content-Type': 'application/json' }}
	})
	    .then(res => {
		console.log(res.data);
	    })
	    .catch(function (error){
                console.log(error);
		this.props.onPageChange("Main");
	    })
    }

    render() {
        return (
            <div className="form-inline text-center">
	      <div className="col-md-12 form-group">
		<label htmlFor="username" className="col-form-label">Username: </label>
		<input type="text" placeholder="Enter username" id="username" className="form-control" onChange={(text) => this.onUsernameChange(text)} />
	      </div>
	      <div className="col-md-12 form-group">
		<label htmlFor="password" className="col-form-label">Password: </label>
		<input type="password" placeholder="Enter password" id="password" className="form-control" onChange={(text) => this.onPasswordChange(text)} />
	      </div>
	      <div className="col-md-12 form-group">
		<button className="btn btn-primary btn-sm m-2" onClick={this.login}>Login</button>
	      </div>
            </div>
        )
    }
}
